import React, {Component} from 'react';
import {Link} from 'react-router-dom';
import "../newArrivals/arrivalsElement.css";

export default class CategoryElement extends Component{
    constructor(props){
        super(props);
    }
    render () {
        const {bookItem} = this.props;
        return(
            <div className="card">
            <div className="card-details">
                <img className="book-img" src={bookItem.image}/>
                <div className="book-title"><Link to={{
                    pathname: "/book",
                    state: {
                        id:resultItem.id,
                        title:resultItem.title,
                        author:resultItem.author,
                        category:resultItem.category,
                        genre:resultItem.genre,
                        format:resultItem.format,
                        isbn:resultItem.format,
                        description:resultItem.description,
                        publisher:resultItem.publisher,
                        image:resultItem.image,
                        price:resultItem.price,
                        size:resultItem.size,
                        publihedDate:resultItem.publihedDate,
                        language:resultItem.language
                    }
                }}>{bookItem.title}</Link></div>
                 <div className="book-author">by {bookItem.author}</div>

            </div>    
        </div>

        );   
    }
}
